import React from 'react'
import Header from './Grids/Header'
import Content from './Grids/Content'
import Menu from './Grids/Menu'
import './App.css'

function App() {
  return (
    <div className="App">
      <div className='containerGrids'>
        <div><Header /></div>
        <div>
          <Menu className='Menu' />
          <Content />
        </div>
      </div>
    </div>
  );
}

export default App;
